        FORTNITE_GIFT_INVENTORY_INFO:
          "F\xe5 udstyr, der matcher din {guardOutfitName}!\n\nFra den 4. maj kan du l\xe5se op for Discord-droppet {rewardName} ved at g\xf8re \xe9n af to ting:\n\nStream live, og sk\xe6rmdel Fortnite p\xe5 Discord i 15 minutter eller mere til mindst \xe9n Discord-ven.\n\nEfter 15 minutters sk\xe6rmdeling med en ven modtager du et link som gave, som du finder under Indstillinger > Gavebeholdning.\n\nKlik p\xe5 linket for at logge ind p\xe5 din Epic Games-konto, og dit nye wrap vil blive f\xf8jet til dit Fortnite Locker!\n\nKan du ikke streame? Du kan ogs\xe5 acceptere en Discord Bot Quest! Start med at tilmelde dig den [officielle Fortnite Discord-server](http://discord.gg/fortnite).\n\nP\xe5 serveren vil du se en bot, du kan interagere med for at deltage i en Discord Quest.\n\nN\xe5r du interagerer med botten, bliver du f\xf8rt til en side, hvor du kan linke dine Epic- og Discord-konti.\n\nEfter du har linket dine konti, kan du deltage i questen, hvor du skal fuldf\xf8re en opgave inde i Discord og en opgave inde i Fortnite.\n\nN\xe5r begge disse opgaver er fuldf\xf8rt, vil dit wrap blive f\xf8jet til dit Fortnite Locker!\n\nF\xe5 mere at vide p\xe5 vores blogindl\xe6g!\n",
